<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Namu's Delight | Coming Soon</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Moderustic:wght@300..800&family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap" rel="stylesheet">
    <style>
        body {
            font-family: "Roboto", sans-serif;
            font-weight: 400;
            font-style: normal;
            background-color:#f1d1b1;
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            text-align: center;
        }

        a, a:visited, a:focus{
            text-decoration: none;
            color: #6B3413;
        }

        .footer-icon {
            max-width: 20px;
            vertical-align: middle;
        }

        .main-logo {
            max-width: 100%;
        }
        

        .container {
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100vh; /* This makes the container full height of the viewport */
        }
        .box {
            margin: 10px;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .form-container{
            padding: 2rem; 
            display: block;
            background-color: white;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
            border-radius: 10px; 
            margin: 0 2em;
        }

        .form-container h1 {
            color: #6B3413;
            margin-bottom: 1rem;
        }
        .form-container p {
            color: #6B3413;
            margin-bottom: 2rem;
        }
        .form-container .phone-form {
            display: flex;
            justify-content: center;
            margin-bottom: 1rem;
        }
        .form-container input[type="tel"] {
            padding: 0.5rem;
            font-size: 1rem;
            border: 1px solid #ccc;
            border-radius: 4px 0 0 4px;
            max-width: 200px;
        }
        .form-container button {
            padding: 0.5rem 1rem;
            font-size: 1rem;
            background-color: #007bff;
            color: white;
            border: none;
            border-radius: 0 4px 4px 0;
            cursor: pointer;
        }
        .form-container button:hover {
            background-color: #0056b3;
        }
        .form-container #message {
            margin-top: 1rem;
            font-weight: bold;
        }
    </style>
</head>

        </div>
        <div class="box form-container">
            <p>We're working hard to bring you something amazing. Stay tuned!</p>
            <form id="phone-form" class="phone-form">
                <input type="tel" id="phone" name="phone" placeholder="Enter your phone number" required>
                <button type="submit">Notify Me</button>
            </form>
            <p>Be the first to know when we launch new products.</p>
            <div id="message"></div>
        </div>
        <div class="box">
            <a href="https://www.instagram.com/namusdelight/" target="_blank"><img src="assets/insta.webp" class="footer-icon" alt="namusdelight"> Follow us on Instagram</a>
        </div>
        
    </div>
    <script>
        // Phone number validation
        function validatePhoneNumber(phone) {
            const phoneRegex = /^[\+]?[(]?[0-9]{3}[)]?[-\s\.]?[0-9]{3}[-\s\.]?[0-9]{4,6}$/;
            return phoneRegex.test(phone);
        }

        window.onload = function () {
            // Form submission
            document.getElementById('phone-form').addEventListener('submit', function(e) {
                e.preventDefault();
                var phone = document.getElementById('phone').value;
                
                if (!validatePhoneNumber(phone)) {
                    document.getElementById('message').textContent = 'Please enter a valid phone number.';
                    return;
                }

                var url = 'https://script.google.com/macros/s/AKfycbx5-dMAhwB5CIIAYMNnSK3PZYoBzVDIHuageQJE1zHZitBXP1wAplgDHlG4tiEdtj_SwQ/exec';

                fetch(url, {
                    method: 'POST',
                    mode: 'no-cors',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({phone: phone})
                })
                .then(response => {
                    document.getElementById('message').textContent = 'Thank you for subscribing!';
                    document.getElementById('phone').value = '';
                })
                .catch(error => {
                    document.getElementById('message').textContent = 'An error occurred. Please try again.';
                });
            });
        };
    </script>
